import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page to show view toggle buttons
    await page.click('div.category-card:has-text("Electronics")');
    await page.waitForLoadState('networkidle');

    // Wait for view toggle buttons to be visible
    await page.waitForSelector('.view-toggle', { timeout: 10000 });

    // Click the list view button
    await page.click('button[title="List View"]');

    // Wait for view to change to list mode
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Verify the view has changed by checking for list view specific elements
    const listViewProducts = await page.$$eval('.product-card-list', elements => elements.length);
    const gridViewProducts = await page.$$eval('.product-card', elements => elements.length);

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        listViewProductsCount: listViewProducts,
        gridViewProductsCount: gridViewProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
